import React from 'react'

const TextForm = () => {
    return (
        <div className='container'>
            <div className="mb-3">
                <label for="mybox" className="form-label">Example textarea</label>
                <textarea className="form-control" id="mybox" rows="3"></textarea>
            </div>
        </div>
    )
}

export default TextForm
